import * as rr from './ReactiveRobot'
import * as ev from './Events'

export function getData(){
  console.log('DataService==>getData()')
  //make some fake data, but this could easily be coming from an api call//
  let interval = setInterval(()=>{
    let rand = Math.random()
    if(rand < 0.33){
      rr.trigger({type:ev.APP_TEST,data:{name:'hello App'}})
    }else if(rand < 0.66){
      rr.trigger({type:ev.COMPONENT1_TEST,data:{name:'hello Component1'}})
    }else{
      rr.trigger({type:ev.COMPONENT2_TEST,data:{name:'hello Component2'}})
    }

  },1000)
}
